import "./App.css";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Home from "./Home";
import About from "./About";
import Contact from "./Contact";

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/result">
            <page3 />
          </Route>
          <Route path="/lens">
            <page2 />
          </Route>
          <Route path="/">
            <page1 />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
